// SPDX-License-Identifier: MIT
pragma solidity =0.8.7;
contract Retorno{
    int public contagem ;
    function  incremetal()public{
      incrementalInternal();      
    }
   function incrementEx()external{
       decrementaltPrivat();
    }
    function decrementaltPrivat()private{
       contagem = contagem +1;
    }
    function incrementalInternal()internal{
       contagem = contagem +1;
    }
  
}

